window.bookSummaryJSON = "<p><b>I’m Michael Gilmore, bearer of Noctis the Onyx Dragon, the only male student of Drako Academy, and apparently, the one person who can save a dying world.</b></p> <p>Only a few days ago, I was transported from Los Angeles to a fantasy world teeming with super-powered female soldiers who can command the magic of their bonded dragons. Except the dragons are dying out. And I’m going to bring them back. But no one knows how I can do it. After all, how do you breed dragons? The answer lies within Drako Academy and the stunning female dragonmancers inside its crystal walls.</p>"; 
